let currentId = 0

app.get('/id', (req, res) => {
    const id = currentId
    currentId++
    res.send({ id: id, burnerAddress: ACCOUNTS[id].account })
})

// Basic route
app.get('/sozo/execute/:id', (req, res) => {
    const { id }     = req.params
    const {
        contract, selector, calldata
    } = req.query

    const account = ACCOUNTS[id]
    let sozoQuery = "sozo execute " + contract + " " + selector
    if (calldata) {
        sozoQuery += " --calldata " + calldata
    }
    sozoQuery += ` --private-key ${account.private} --account-address ${account.account}`
    exec(sozoQuery, (error, stdout, stderr) => {
        if (error) {
            console.error(`Error: ${error.message}`);
            return;
        }
        if (stderr) {
            console.error(`Stderr: ${stderr}`);
            return;
        }
        console.log(`Stdout: ${stdout}`);
    });
});

// 404 Error Handler
app.use((req, res, next) => {
    res.status(404).send('Page not found');
});

// General error handler
app.use((error, req, res, next) => {
    console.error(error);
    res.status(500).send('Internal Server Error');
});

app.listen(port, () => {
    console.log(`Server is running on port ${port}`);
});

